import { useParams, Route } from "react-router-dom";
import Comments from "../components/comments/Comments";
const QuoteDetail = ()=>{
    const id = useParams();
    return (<div>
                <h1>QuoteDetails</h1>
                <h2>{id.quoteId}</h2>
                <Route path={'/allquotes/:quoteId/comments'}>
                    <Comments/>
                </Route>
            </div>)
}
export default QuoteDetail;
